INSERT INTO `benda_devosi` (`id_benda`, `judul`, `judul_seo`, `isi`, `gambar`, `tanggal`, `oleh`, `aktif`) VALUES
(1, 'SALIB TALI DINDING 40cm', 'salib-tali-dinding-40cm', '<p>Salib Tali ini merupakan opsi lain untuk diletakkan di dalam rumah Anda.</p>\r\n<p><span style="text-decoration: line-through;">Rp 70.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp 59.500,-</p>', '56S TALI 40.JPG', '2015-09-26 00:00:00', 'admin', 'Ya'),
(2, 'SALIB MAWAR DINDING 40cm', 'salib-mawar-dinding-40cm', '<p>Salib merupakan identitas Anda sebagai orang Kristiani. Salib Mawar ini merupakan pilihan yang tepat untuk diletakkan di dalam rumah Anda.</p>\r\n<p><span style="text-decoration: line-through;">Rp.70.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp 59.500,-</p>', '19S MAWAR 40.JPG', '2015-09-26 00:00:00', 'admin', 'Ya'),
(3, 'PATUNG NATAL 10cm', 'patung-natal-10cm', '<p>Patung Natal Kecil ini sangat cocok untuk diletakkan di ruangan yang kecil sehingga suasana Natal di rumah Anda semakin indah.</p>\r\n<p><span style="text-decoration: line-through;">Rp 190.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp 161.500,-</p>', '91NATAL 10.JPG', '2015-09-26 00:00:00', 'admin', 'Ya'),
(4, 'PATUNG DIORAMA', 'patung-diorama', '<p><span style="text-decoration: line-through;"><br /></span>Ingin Punya Patung Natal namun yang sederhana? Patung Dioramalah pilihan terbaik untuk Anda. Bisa ditelatakkan di sudut meja atau di ruangan yang kecil.</p>\r\n<p><span style="text-decoration: line-through;">Rp 115.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp 97.750,-</p>', '23DIORAMA.JPG', '2015-09-26 00:00:00', 'admin', 'Ya'),
(5, 'SALIB MILENIUM DUDUK', 'salib-milenium-duduk', '<p>Salib Milenium duduk ini bisa digunakan untuk berbagai kebutuhan doa, ibadat, bahkan sembahyangan di rumah Anda. Bentuknya kecil, sangat ringan, dan harga terjangkau.</p>\r\n<p><span style="text-decoration: line-through;">Rp. 35.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp 29.750,-</p>', '72SD MILENIUM.JPG', '2015-10-01 15:17:57', 'admin', 'Ya'),
(6, 'SALIB BENEDIKTUS DINDING', 'salib-benediktus-dinding', '<p>Anda membutuhkan salib dinding yang kecil? Salib Benediktus ini merupakan pilihan yang tepat dengan harga yang terjangkau.</p>\r\n<p><span style="text-decoration: line-through;">Rp. 55.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp. 46.750,-</p>', '19S BENEDIKTUS.JPG', '2015-10-01 15:20:19', 'admin', 'Ya'),
(7, 'PATUNG KELUARGA KUDUS DUDUK 25cm', 'patung-keluarga-kudus-duduk-25cm', '<p>Anda membutuhkan patung keluarga kudus yang kecil? Patung Keluarga Kudus Duduk inilah pilihan yang paling tepat dan harganya pun terjangkau.</p>\r\n<p><span style="text-decoration: line-through;">Rp. 70.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp 59.500,-</p>', '62KK DUDUK 25.JPG', '2015-10-01 15:22:56', 'admin', 'Ya'),
(8, 'PATUNG KELUARGA KUDUS BERDIRI 40cm', 'patung-keluarga-kudus-berdiri-40cm', '<p>Anda membutuhkan Patung Keluarga Kudus yang Besar? Inilah patung pilihan yang tepat dan cocok untuk diletakkan di ruangan yang cukup besar.</p>\r\n<p><span style="text-decoration: line-through;">Rp. 110.000,-</span></p>\r\n<p>Disc. 15%</p>\r\n<p>Rp. 93.500,-</p>', '68KK BERDIRI 40.JPG', '2015-10-01 15:30:56', 'admin', 'Ya');
INSERT INTO `buku` (`id_buku`, `id_kategori`, `id_sub_kategori`, `id_author`, `judul`, `judul_seo`, `sinopsis`, `tgl_terbit`, `berat`, `stok`, `gambar`, `dimension`, `dibeli`, `diskon`, `harga`, `isbn`, `ean`, `tgl_update`, `bestseller`, `preorder`, `new_release`, `catalog`) VALUES
(546, 48, 14, '333', '33', '33', '', '1900-01-01', '0.00', 0, '753540', '', 0, 0, 0, '', '', '2016-01-15 10:42:52', '', 'N', 'No', 'No'),
(443, 45, 0, 'retagalih.pHe ', 'Cerita Cinta Sehari', 'cerita-cinta-sehari', '<p>Arus Tenang Laut Biru. Rangkaian nama indah itu gambarkan sosok idaman berperawakan tinggi tegap kekar dengan garis wajah tampan matang sempurna, berbalut sikap tenang bijaksana tak banyak bicara, dilengkapi kecerdasan warisan lima tahun hidup di Kanada, dan karir sebagai Konsultan IT bermasa depan cerah.</p>\r\n<p>Sayang, sempurna sosoknya tak sebanding dengan cerita cinta. Kala pertunangan matang dirancang setelah tiga tahun saling cinta, kekasih hati alami kecelakaan tragis saat menuju gedung pertunangan. Plash, cintanya, koma 9 hari dan sadar dengan amnesia yang tak terhindarkan. Plash lupa segala hal, termasuk cerita cinta dan rencana pertunangan. Empat tahun Laut setia dampingi Plash namun semua tulusnya pengorbanan itu berbuah pengkhianatan. Amnesia membuat Plash terlahir menjadi pribadi baru yang mencintai kakak kandung Laut. Laut hancur, hasilkan ombak besar pencipta tsunami kencang yang siap enyahkan bumi di hadapan. Dilema dirasa kala dihadapkan pada dua pilihan. Rela melepas cinta yang sudah 7 tahun dipeluk untuk biarkan Plash temukan hidup dan cinta baru? Ataukah tetap mati-matian pertahankan cinta walau terus tak dianggap dengan cinta yang tak dibalas?</p>\r\n<p>Akhirnya, hanya CERITA CINTA SEHARI yang sanggup menjawab gelisah hati.</p>', '1900-01-01', '1.00', 77, 'ilustrasi.jpg', '14x21cm', 0, 50, 39000, '', '', '2016-01-06 20:47:28', 'N', 'N', 'No', 'No'),
(445, 43, 0, 'Angela Adiratna ', 'Parent Prenuer: 35 Trend Bisnis Menggiurkan â€“ Modal Dibawah 2 Juta Omset ', 'parent-prenuer-35-trend-bisnis-menggiurkan-â€“-modal-dibawah-2-juta-omset', '<p>Buku yang Anda pegang ini lahir dari sebuah keprihatinan bahwa di luar sana banyak orang senasib Anda yang hanya diam, pasrah, dan akhirnya tidak berdaya sama sekali. Anda tidak boleh mati sebelum waktunya. Anda sangat dibutuhkan oleh anak-anak Anda dan orang-orang di sekitar Anda. <em>Selling point</em> yang perlu Anda perhatikan dan temukan dalam buku ini, antara lain:</p>\r\n<ul>\r\n<li>Mempersiapkan diri dan mental Anda untuk bangkit dan masuk ke&nbsp; dalam dunia wirausaha (<em>enterpreneurship</em>).</li>\r\n<li>Mempersiapkan diri dengan karakter yang &ldquo;super&rdquo; agar Anda siap menerjang dan melakoni hidup sebagai seorang pengusaha yang tahan banting dan sukses meniti jalan <em>enterpreneurship</em>.</li>\r\n<li>Membantu Anda dengan memberikan nama usaha yang menarik dan realistis, peluang yang ada, cara-cara promosi yang bisa ditempuh, kalkulasi perhitungan modal awal, perhitungan operasional, <em>Break Event Point</em> (balik modal dalam berapa bulan), dan margin keuntungannya.</li>\r\n<li>Modal pun saya sesuaikan diangka 1 jutaan sampai 5 jutaan saja. Ringan bukan? Jadi, semua paparan ini komprehensif dan realistis.</li>\r\n</ul>\r\n<p>Mari baca dan temukan inspirasi yang saya hidangkan ini. Saya berharap Anda dapat menemukan inspirasi hidup agar hidup Anda berkelimpahan berkat dengan usaha yang cocok dengan diri dan kemampuan Anda.</p>', '2014-03-01', '1.00', 77, 'ilustrasi.jpg', '14x21cm', 0, 50, 35000, '', '', '2016-01-06 20:47:54', 'N', 'N', 'No', 'No'),
(446, 43, 0, 'Angela Adiratna ', '10 Langkah Manajerial Outside The Box', '10-langkah-manajerial-outside-the-box', '<p>Buku ini dipersembahkan bagi para pemilik perusahaan yang ingin memperbaiki kualitas personil manajernya. Pengetahuan dan pemahaman yang disampaikan dapat menjadi pegangan dalam pengontrolan peran seorang manajer yang Anda rekrut nantinya. Tentu harapannya dengan merekrut mereka yang berkompeten, omzet dan target Anda tercapai. Buku ini pun sangat cocok bagi Anda yang dipromosikan menjadi seorang manajer (lini atas, menengah, dan bawah) agar Anda benar-benar tahu dan memahami aturan main bagi seorang manajer. Anda memegang peranan kunci bagi perusahaan Anda. Tampuk tanggung jawab Anda semakin besar dan Anda siap untuk menjalankan roda perusahaan. Melalui buku ini Anda akan dibimbing untuk fasih dalam tugas-tugas Anda dan menjadi partner bagi pimpinan Anda. Semoga Anda menjadi manajer yang outside the box dalam memimpin roda perusahaan yang telah dipercayakan kepada Anda. Sukses selalu!</p>', '2014-04-01', '1.00', 77, 'ilustrasi.jpg', '14x21cm', 0, 50, 45000, '', '', '2016-01-06 20:48:06', 'N', 'N', 'No', 'No'),
(486, 46, 0, '', 'KAOS MARIA ASSUMPTA DEWASA PUTIH', 'kaos-maria-assumpta-dewasa-putih', '<p>Kaos Maria Assumpta Dewasa dengan warna putih ini tersedia berbagai ukuran mulai dari S, M, L, XL</p>', '0000-00-00', '1.00', 20, 'ilustrasi.jpg', '', 0, 40, 85000, '', '', '2016-01-06 21:00:22', 'N', 'N', 'No', 'No'),
(505, 46, 0, '', 'KAOS MARIA ASSUMPTA DEWASA HITAM', 'kaos-maria-assumpta-dewasa-hitam', '<p>Kaos Maria Assumpta Dewasa dengan warna hitam ini tersedia berbagai ukuran mulai dari S, M, L, dan XL</p>', '0000-00-00', '1.00', 20, 'ilustrasi.jpg', '', 0, 40, 85000, '', '', '2016-01-06 20:59:44', 'N', 'N', 'No', 'No'),
(504, 46, 0, '', 'KAOS MARIA ASSUMPTA ANAK', 'kaos-maria-assumpta-anak', '<p>Kaos Maria Assumpta Anak tersedia ukuran M dan L dengan warna kuning yang disukai anak-anak</p>', '0000-00-00', '1.00', 20, 'ilustrasi.jpg', '', 0, 40, 65000, '', '', '2016-01-06 21:00:06', 'N', 'N', 'No', 'No'),
(506, 46, 0, '', 'KAOS MARIA ASSUMPTA DEWASA VECTOR', 'kaos-maria-assumpta-dewasa-vector', '<p>Kaos Maria Assumpta Dewasa dengan desain vektor ini tersedia berbagai ukuran mulai dari S, M, L, dan XL</p>', '0000-00-00', '1.00', 20, 'ilustrasi.jpg', '', 0, 40, 80000, '', '', '2016-01-06 20:59:19', 'N', 'N', 'No', 'No'),
(507, 46, 0, '', 'KAOS YESUS & ANAK-ANAK', 'kaos-yesus--anakanak', '<p>Kaos Yesus dan Anak-anak ini merupakan kaos kesukaan anak-anak. Bukan hanya gambarnya yang menarik, tetapi warna kuning juga sangan disukai anak-anak. Ayo buruan, stok terbatas dan harga terjangkau</p>', '0000-00-00', '1.00', 12, 'ilustrasi.jpg', '', 0, 40, 65000, '', '', '2016-01-06 20:58:45', 'N', 'N', 'No', 'No');
