(3, 'CETAK BROSUR, LEAFLET, POSTER, DLL SERBA MURAH', 'cetak-brosur-leaflet-poster-dll-serba-murah', '<p>ANDA INGIN MENCETAK BROSUR, POSTER, LEAFLET, DLL? KAMI BERI LANGSUNG POTONGAN HARGA BAGI ANDA YANG LANGSUNG MENGHUBUNGI KAMI.</p>\r\n<p>SEGERA HUBUNGI!!!</p>\r\n<p>PRATAMA MAYANG (SMS/WA: 0878 3931 8550)</p>', '17brochure02.jpg', 'admin', '2015-09-26 00:00:00', 'Ya'),
(4, 'CETAK BUKU MURAH', 'cetak-buku-murah', '<p>ANDA INGIN MENCETAK BUKU, MAJALAH, JOURNAL DALAM JUMLAH YANG TERBATAS ATAU BAHKAN SAMPAI RIBUAN?</p>\r\n<p>SERAHKAN PADA KAMI SEMUA KEBUTUHAN ANDA. KAMI SEDIKAN LANGSUNG POTONGAN 10% BAGI ANDA YANG LANGSUNG MENGHUBUNGI KAMI.</p>\r\n<p>AYO HUBUNGI SEGERA!!!</p>\r\n<p>PRATAMA MAYANG (SMS/WA: 0878 3931 8550)</p>', '132.jpg', 'admin', '2015-09-26 00:00:00', 'Ya'),
(5, 'CETAK KALENDER MURAH', 'cetak-kalender-murah', '<p>MAU CETAK KALENDER PLUS POTONGAN HARGA 10%?</p>\r\n<p>Tersedia Kalender Dinding dengan finishing Klem Seng atau Spiral, Kalender Dinding Lipat, Kalender Meja baik 7 maupun 13 halaman.</p>\r\n<p>HUBUNGI SEGERA?</p>\r\n<p>PRATAMA MAYANG (SMS/WA: 0878 3931 8550)</p>', '141.jpg', 'admin', '2015-09-29 15:31:31', 'Ya');
