INSERT INTO `modul` (`id_modul`, `nama_modul`, `link`, `static_content`, `gambar`, `status`, `aktif`, `menu`) VALUES
(1, 'User', '?module=user', 'Modul pengaturan akun administrator website. Gunakan untuk mengganti password dan atau menambah admin pengelola website. Hak akses setiap user yang dibuat melalui modul ini adalah admin. ', '', 'admin', 'N', 'utama'),
(2, 'Slideshow', '?module=slider2', 'Modul pengaturan slideshow di halaman home website. Dengan modul ini anda bisa mengupload foto untuk ditampilkan sebagai slideshow di halaman depan (home) website. Perhatikan <b>ukuran pixel foto</b>  (panjang dan lebar) yang telah ditetapkan (di halaman modul) saat mengupload foto anda. ', '', 'admin', 'N', 'modul'),
(3, 'page', '?module=page', 'Modul pengaturan halaman statis atau page di website. Modul ini digunakan untuk mengelola halaman statis seperti halaman profil(about us).', '', 'admin', 'N', 'modul'),
(5, 'Menu', '?module=menu', 'Modul menu.', '', 'admin', 'N', 'utama'),
(10, 'Hubungi', '?module=hubungi', 'Modul ini berfungsi untuk mengelola pesan pengunjung, yang diterima melalui form kontak di halaman kontak(contact us). Tidak hanya untuk membaca pesan tapi anda juga bisa langsung membalas email pengunjung tersebut.', '', 'admin', 'N', 'modul'),
(11, 'Banner', '?module=banner', 'Module Banner. Modul ini digunakan untuk menampilkan url dalam bentuk gambar untuk konten promo dan link di sidebar.', '', 'admin', 'Y', 'modul'),
