INSERT INTO `mod_page` (`id_page`, `judul`, `isi`, `tgl_posting`, `gambar`, `statis`, `extra`) VALUES
(1, 'home', '<p>Selamat datang di website Solusi Buku.</p>', '2013-01-09', '', 'N', ''),
(2, 'Company Profile', '<p>Charissa Publisher merupakan penerbit buku-buku populer yang menerbitkan buku-buku Kristiani populer dan berbagai buku umum lainnya. <strong><em>Charissa</em></strong> berasal dari bahasa Latin <em>Charitas</em>, Inggris <em>Charity.</em> <strong><em>Charissa</em></strong> merupakan bentuk lain dari <em>Charitas</em>, yang artinya adalah KASIH.</p>\r\n<p>Cikal bakal Penerbit Charissa Publisher, yang berdiri sejak 1 Juli 2012 ini, memang ingin berkecimpung dalam buku-buku Kristiani Populer, namun dalam perjalanan waktu Penerbit Charissa Publisher juga ingin merambah ke dunia umum dengan menerbitkan berbagai kategori buku umum.</p>\r\n<p>Kini Charissa Publisher tidak hanya bergerak di bidang penerbitan, tetapi bergerak juga di bidang percetakan. Bahkan melebarkan sayapnya untuk memproduksi berbagai benda-benda rohani dan berbagai souvenir rohani, seperti patung, rosario, kaos, dll.</p>', '2013-01-09', '', 'Y', ''),
(9, 'Cara Belanja', '<p><strong>Cara Memilih Buku</strong></p>\r\n<ul>\r\n<li>Anda bisa langsung mencari buku berdasarkan judul, penulis, maupun kategori di kolom &ldquo;search&rdquo; di sebelah kanan atas.</li>\r\n<li>Anda juga bisa langsung memilih dari kolom &ldquo;Categories/Kategori&rdquo; yang ada di sebelah kiri.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Cara Membeli Buku</strong></p>\r\n<ul>\r\n<li>Pilih buku yang diinginkan dengan cara klik gambar buku</li>\r\n<li>Tentukan jumlah buku yang ingin Anda beli</li>\r\n<li>Klik &ldquo;Add to Cart&rdquo;</li>\r\n<li>Klik &ldquo;Continue Shopping&rdquo;, bila Anda ingin memilih buku yang lain.</li>\r\n<li>Klik &ldquo;View Cart&rdquo;, bila Anda ingin mengecek keranjang belanja Anda. Anda bisa mengedit jumlah buku yang ingin Anda beli di &ldquo;kolom jumlah&rdquo;, maka secara otomatis jumlah subtotal akan menyesuaikan. Anda juga bisa menghapus buku yang tidak Anda inginkan dengan klik &ldquo;tombol sampah&rdquo; di samping kanan.</li>\r\n<li>Jika Anda ingin melanjutkan belanja, maka klik &ldquo;Continue Shopping&rdquo;. Jika Anda sudah selesai berbelanja, maka klik tanda &ldquo;Checkout&rdquo;.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Login Anggota</strong></p>\r\n<p>Bila Anda sudah mendaftar sebagai anggota, Anda langsung mengisi username dan password Anda, lalu klik &ldquo;Login&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Cara Mendaftar Menjadi Anggota</strong></p>\r\n<ul>\r\n<li>Bila Anda belum mendaftar sebagai Anggota, Klik tombol &ldquo;Create an Account&rdquo;.</li>\r\n<li>Isikan data diri Anda secara lengkap, lalu klik &ldquo;register&rdquo;.</li>\r\n</ul>', '2014-03-21', '', 'Y', ''),
(10, 'cara pembayaran', '<ul>\r\n<li>Klik keranjang belanja Anda, lalu klik &ldquo;Checkout&rdquo;.</li>\r\n<li>Maka akan tampil form pesanan Anda yang sudah dilengkapi dengan data diri serta buku yang Anda pesan.</li>\r\n<li>Bila Anda sudah yakin dengan semua form pesanan tersebut, klik &ldquo;Place Order&rdquo;.</li>\r\n<li>Maka akan tampil nota pesanan Anda, beserta nomor ID orderan Anda.</li>\r\n<li>Anda dapat mengecek di email Anda, form pesanan Anda.</li>\r\n<li>Silakan lakukan pembayaran melalui ATM, Bank, ataupun Internet Banking ke nomor rekening yang ada di email Anda.</li>\r\n<li>Bila Anda sudah melakukan pembayaran, silakan melakukan konfirmasi pembayaran di tokorohanionline.com dengan klik &ldquo;Status Order&rdquo;/&rdquo;My Order&rdquo; yang ada di bagian kanan paling atas.</li>\r\n<li>Klik &ldquo;Detail&rdquo; untuk melihat kembali form pesanan Anda, atau bisa langsung klik &ldquo;Confirm Order&rdquo;/&rdquo;Konfirmasi Order&rdquo;</li>\r\n<li>Isilah data konfirmasi pembayaran Anda sesuai sesuai dengan form pesanan yang ada di email Anda.</li>\r\n<li>Setelah selesai, klik &ldquo;Confirm Order&rdquo;.</li>\r\n<li>Proses pembayaraan Anda sudah selesai. Anda akan segera mendapat email konfirmasi pembayaran dan buku akan segera kami kirim.</li>\r\n<li>Terima kasih dan kami tunggu kedatangan Anda berbelanja buku-buku terpopuler dan terlengkap hanya di tokorohanionline.com</li>\r\n</ul>', '2014-03-24', '', 'Y', ''),
(11, 'Ayo Buat Buku', '<p align="center"><strong>STANDAR PENULISAN NASKAH</strong></p>\r\n<p>Ukuran kertas&nbsp; : A4</p>\r\n<p>Font&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Times New Roman</p>\r\n<p>Ukuran font&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 12</p>\r\n<p>Spasi&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 1,15</p>\r\n<p>Margin&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Top (2,5cm)-Bottom (2,5cm)-Left (2,5cm)-Right (2,5cm)</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p align="center"><strong>SISTEM PENERBITAN BUKU</strong></p>\r\n<p><strong>1. </strong><strong>Sistem Beli Putus</strong></p>\r\n<p>Dengan sistem ini, Penerbit Charissa akan membeli secara <em>cash</em> naskah penulis dengan harga yang telah disepakati bersama. Naskah yang sudah dibeli oleh Penebit Charissa, maka sepenuhnya naskah sudah menjadi hak milik Penerbit.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>2. </strong><strong>Sistem Royalti</strong></p>\r\n<p>Dengan sistem ini, Penerbit akan memberikan royalti secara bertahap kepada penulis dari setiap buku yang terjual. Besaran royalti yaitu 10% dari harga jual buku. Besaran royalti ini dapat berubah sesuai kesepakatan dengan penulis.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>3. </strong><strong>Sistem POD <em>(Print On Demand) </em></strong></p>\r\n<p>Dengan sistem ini, Penerbit Charissa akan menerbitkan naskah penulis dengan biaya cetak dari penulis. Penerbit akan mencetak buku sesuai jumlah yang diminta penulis.</p>\r\n<p>&nbsp;</p>\r\n<p align="center"><strong>9 LANGKAH PROSES</strong><strong> PENERBITAN BUKU</strong></p>\r\n<ol>\r\n<li>Penulis memilih sistem penerbitan yang disediakan</li>\r\n<li>Penulis mengirimkan naskah, surat pernyataan keaslian, biodata/CV melalui email atau by POS/TIKI/JNE, dll</li>\r\n<li>Penerbit menyeleksi naskah (<span style="text-decoration: underline;">+</span> 2 minggu). Untuk sistem POD, proses naskah langsung ke no 6</li>\r\n<li>Penerbit akan mengontak penulis melalui email naskah diterima atau ditolak</li>\r\n<li>Bila naskah diterima, maka Penerbit menawarkan dengan sistem penerbitan yang ada. Bila royalti, nanti akan ada Surat Perjanjian Penerbitan (SPP). Bila beli putus, maka akan ada Surat Perjanjian Pembelian Naskah (SPPN) dan mendapatkan honor atas pembelian naskah tsb.</li>\r\n<li>Penerbit akan mengolah naskah, misalnya mengedit, layout dan desain cover</li>\r\n<li>Penerbit akan mencetak sample/dummy</li>\r\n<li>Penerbit akan mencetak buku dalam partai besar sesuai kesepakatan</li>\r\n<li>Buku mulai didistribusikan di seluruh Toko buku Gramedia, Togamas, Social Agency, dll<br /><br /><a href="http://www.ayobuatbuku.wordpress.com" target="_blank">Ayo Buat Buku<br /><br /><br /></a></li>\r\n</ol>', '2015-09-28', '', 'Y', ''),
(5, 'contact us', '<div class="cards-text-truncate-and-wrap"><span>Gg. Lusi No. 25 Kauman, Kutosari, Kebumen</span></div>\r\n<div class="cards-text-truncate-and-wrap">Daerah Istimewa Yogyakarta 55281</div>\r\n<p>PIN BBB: 2789F135 / SMS/CALL: 0878 3999 2261</p>\r\n<p>E-mail: yulifundinz@gmail.com</p>\r\n<p>Atau&nbsp;</p>\r\n<p>MARKUS PRATAMA MAYANG A. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<p>WA: 0878 3931 8550 / PIN BBM: 51A60127</p>\r\n<p>&nbsp;</p>\r\n<p>ANTON PURWOKO</p>\r\n<p>WA: 0856 4300 6967 / PIN BBM: 51BFA079</p>', '2013-01-09', '<iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3324.2924820331114!2d110.39107964371526!3d-7.760922484499462!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x76b0ab343c9d3216!2sToko+Rohani+Charissa!5e0!3m2!1sid!2sid!4v1448596888175" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', 'N', 'rhfauzi7@gmail.com'),
(14, 'Resensi', '<p>Jika Anda ingin mengirimkan resensi buku yang ada di website ini, silakan email ke admin@solusibuku.com</p>', '2014-03-27', '', 'N', ''),
(3, 'i-POD (Investasi Print On Demand)', '<p>Tentu Anda bertanya-tanya, apa itu i-POD?</p>\r\n<p>i-POD di sini tentu bukan iPod yang merupakan salah satu produk Apple.</p>\r\n<p>i-POD merupakan Investasi Print On Demand.</p>\r\n<p>Lalu, Print On Demand itu apa?</p>\r\n<p>Print On Demand merupakan salah satu sistem di mana Anda bisa menerbitkan buku Anda dalam jumlah yang terbatas sesuai dengan kebutuhan Anda.</p>\r\n<p>&nbsp;</p>\r\n<p>Dengan sistem i-POD ini, kami menawarkan kepada Anda untuk berinvestasi dengan sistem i-POD.</p>\r\n<p>Mudah kok caranya!!!</p>\r\n<p>Anda hanya cukup mengeluarkan modal 5 juta atau lebih, maka Anda akan mendapatkan keuntungan 2 kali lipat dengan buku yang Anda cetak dengan sistem kami ini.</p>\r\n<p>Hubungi segera Penerbit Charissa Publisher yang selalu siap membantu Anda untuk merealisasikan ide-ide Anda yang brilian sembari berinvestasi dengan strategi yang riil dan bukan bayang-bayang semata.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Don''t give up to realize your brilliant idea!</em></strong></p>\r\n<p><strong><em>Charissa Publisher always support you.</em></strong></p>', '2015-09-28', '', 'Y', ''),
(4, 'PROMO OPENING', '<p>FREE SHIPPING</p>\r\n<p>Nimkati promo gratis ongkos kirim dengan belanja di <strong>tokorohanionline.com</strong> minimal Rp 200.000,- untuk Anda yang berdomisili di Yogyakarta</p>\r\n<p>Periode 1 Oktober - 30 November 2015</p>', '2015-09-28', '', 'Y', '');
