(2, '2013-12-19', 'gemb', '<p>yeyy nyampekk</p>'),
(3, '2014-02-01', 'al', '<p>cepet banget nyampeknyaaaa</p>'),
(4, '2014-06-12', 'Gina', '<p>Bukunya keren-keren dan cepat banget nyampenya,makasih<img title="Cool" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-cool.gif" alt="Cool" border="0" /><img title="Cool" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-cool.gif" alt="Cool" border="0" /><img title="Cool" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-cool.gif" alt="Cool" border="0" /></p>'),
(6, '2014-08-01', 'Rudi', '<p>Asyiikkkk...jadi ketagihan beli bukunya</p>'),
(7, '2014-08-04', 'RINA', '<p>Yyyyyyyyyyyeay beli buku dapat undian juga....<img title="Laughing" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-laughing.gif" alt="Laughing" border="0" /><img title="Money Mouth" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-money-mouth.gif" alt="Money Mouth" border="0" /></p>'),
(8, '2014-08-05', 'sinta', '<p>TerimaKasih solusi, buku pesananya sudah sampe.</p>'),
(9, '2014-08-07', 'Agung Surabaya', '<p>Saya kemaren cari-cari buku untuk bahan persiapan CPns,</p>\r\n<p>ketika saya onliine saya buka websitenya, ternyata lengkap buku-bukunya. saya segera melakukan pemesanan, segera bukunya dikirim,</p>\r\n<p>Langsung sampai sesuai pesanannya. Banyak teman-teman saya juga yang pesan bukunya.</p>'),
(10, '2014-08-06', 'Jessica', '<p>Bukunya,,,asyik-asyik,,,gak usah capek-capek Carinya,,,sama belinya,,,heheheh,,Asyikkkk,,,,,,,bukunya udh&nbsp; aq&nbsp; baca ketagihan order lageeeeeeeeeeeee,,,,,,,,,,</p>\r\n<p><img title="Embarassed" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-embarassed.gif" alt="Embarassed" border="0" /><img title="Embarassed" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-embarassed.gif" alt="Embarassed" border="0" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(11, '2014-08-05', 'Ita,ciamis', '<p>Terimakasih www. solusibuku. com. Bukunya sudah diterima Senin kemaren,, Pertama kali belanja di www. solusibuku.com. Proses pelayananmya cepat, responnya cepat, barangnya juga cepat. Lebih praktis belanjanya. Daripada harus ke toko buku</p>\r\n<p>Thenkyuw Very Much. </p>'),
(12, '2014-08-07', 'Rahmania Nur, Malang', '<p>Sore solusi....thenks bingtissssss....buku sherlocknya&nbsp; nyampe......,,,tunggu orderan saya ya,,saya mau koleksi lengkap serinya...biar komplit..<img title="Wink" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-wink.gif" alt="Wink" border="0" /><br /><br /></p>'),
(13, '2014-08-09', 'Susan, Solo', '<p>Awal yang menyenangkan Berbelanja di <a href="http://www.solusibuku.com...gak">www.solusibuku.com...</a>terimakasih solusi</p>'),
(14, '2014-07-06', 'Suryadi, Semarang', '<p>Respon yang sangat cepat ketika order langsung dilayani dengan baik.,////</p>'),
(15, '2014-08-09', 'Yustina, Lampung', '<p>Ketika mencari referensi buku masakan, saya buka webnya ternyata lengkap dan saya langsung order.www.solusibuku.com, menjangkau wilayah seluruh Indonesia.</p>'),
(16, '2014-08-10', 'Linda', '<p>SUdah Ditrrima BUkuya, buku Top No 1 toeefl.ThenkZ solusi buku.</p>'),
(17, '2014-06-05', ' Anita, DOMPU, Mataram', '<p>Halooo.... Saya sekarang tidak perlu lagi mencari toko buku yang lebih lengkap dari www. solusibuku.com. Buku referensi untuk tes TPA lebih lengkap disini,materi materi bukunya sangat lengkap. Apalagi saya jauh disini, tidak perlu khawatir lagi mencari referensi. Saya pasti akan order lagi.</p>'),
(18, '2014-08-11', ' AHMAD, Pesantren, kediri', '<p>bUKUNYA SUDAH sampai, Rabu kemaren..,, solusibuku, makasih banyak.</p>'),
(19, '2014-08-11', 'Arimi, Sumatra Selatan', '<p>Menghadapi Cpns gak perlu biungung,,,kemaren sempet biungung untuk mencari bahan-bahan buku latihan cpns...buka internet langsung dech cari buku online, Ternyata cuma <a href="http://www.solusi.com">www.solusi buku.com</a> yang lengkap dengan buku-buku cpnsnya dan pengiriman yang lengkap sampe ke daerahku, bukunya sudah sampe ya guest</p>'),
(20, '2014-08-14', 'Sera, Jakarta', '<p>Daripada ke toko apalagi di jakarta neh,aduh,,,,,macet disana sini,,gak perlu jalan cuma tunggu di rumah duduk manis,BuKunya langsung sampai di rumah,,,,,www.solusibuku.com recomended bngt..</p>'),
(21, '2014-08-12', 'Reno,Makasar', '<p>Responnya bagus,Ok.</p>'),
(22, '2014-08-11', 'Muis, Padang', '<p>Terimakasih banget untuk <a href="http://www.solusibuku.com..pelayanannya">www.solusibuku.com.Pelayanannya</a>&nbsp;yang sangat ramah, Bukunya sudah sampai sesuai dengan waktunya,saya akan order lagi untuk waktu datang</p>'),
(23, '2014-08-14', 'Intan Suciati', '<p>Buku kategori anak sekolahan lengkap bngt,buat persiapan ujian dan belajar di rumah. Pulang sekolah buku sudah sampai di rumah. Dapet kejutan dari <a href="http://www.solusibuku.com.">www.solusibuku.com.</a>&nbsp;Akhirnya dapat buku yang gak ada di daerahku.&nbsp;<img title="Sealed" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-sealed.gif" alt="Sealed" border="0" /></p>'),
(24, '2014-08-11', 'Novi, Makasar', '<p>Halooooo00000000,apa kareba? Buku psikotest gambar super lengkap, sampeee...ya.....Masih ada khan bukunya? Saya order lageeeeee.....<img title="Embarassed" src="../tinymcpuk/jscripts/tiny_mce/plugins/emotions/img/smiley-embarassed.gif" alt="Embarassed" border="0" /></p>'),
(25, '2014-08-11', 'Vina, Sragen', '<p>Buku The King Bank Soal Super Komplit Kimia sudah sampai, terbungkus rapi, dan sampai tepat pada waktunya. Sukses buat www.solusibuku.com</p>'),
